      new import_obsidian9.Notice("Couldn't find any snippets in your vault!", 1e3);
      if (DisplayController.defaultView === "discovery" /* DISCOVERY */) {
        DisplayController.triggerUIRedraw({ searching: false, fetch: false });
      }
